import Card from "../components/shared/Card"
function AboutPage() {
  return (
    <Card>
      <div className="about">
        <h1>About this project</h1>
        <p>This is react app to leave feedback for the project</p>
        <p>Version 1:0</p>
      </div>
    </Card>
  )
}

export default AboutPage
